  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chautauqua NWR
  outlines Refuge accomplishments from May through August of 1962. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and wildfires. Resource management is outlined;
  topics include commercial fishing. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, fishing, violations, and
  safety. N-R forms and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
